import React from "react"
import {useParams} from "react-router-dom"

export default function Right(props){
    let {count} = useParams();
    let num = count;
    console.log(num, count)
    return (
        Array(count).fill().map(() => <div> I'M A RIGHTY {count} </div>)
    )
}
